      </header> </Col> 



      <section className='bodyArea ' >
     <Row>
         <Col lg={4}>
        <div className='navbar Col-4' >
         <Sidebar />
        </div> </Col>

        <Col lg={8}>
        <div className='content ' >

        </div> </Col>  </Row>

      </section> 



    </div> </Col>



    </Container>

